import Head from "next/head";

export default (
  <div>
    <Head>
      <meta name="viewport" content="width=device-width, initial-scale=1" />
      {/* <link rel="stylesheet" href="/static/main.css" /> */}
    </Head>
    <style jsx global>{`
      body {
        background: #000;
        font: 11px menlo;
        color: #fff;
      }
    `}</style>
  </div>
);
